import React from "react";

const { useState, useEffect } = React;

function HookSample() {
    const [loading, setLoading] = useState(Boolean);
    const [data, setData] = useState<any | null>(null)
    function loadData() {
        setLoading(true);
        setTimeout(() => {
            setLoading(false);
            setData([1, 2, 3, 4, 5]);
        }, 1000);
    }

    // useEffect(loadData, []);
    return (
        <>
            {loading && <p>Loading...</p>}
            {data && <pre>{JSON.stringify(data, null, 1)}</pre>}
        </>
    );
}

export default HookSample;
